import './App.css';
import React from 'react';
import {BrowserRouter as Router, Route, Routes} from "react-router-dom";
import Header from './front/Header';
import Footer from './front/Footer';
import {Home} from './front/Home';
import {Login} from './front/Login';
import {Registration} from './front/Registration';
import {Forgotpassword} from './front/Forgotpassword';
import {PasswordResetting} from './front/PasswordResetting';
import {JobListing} from './front/JobListing';
import {JobAdd} from './front/JobAdd';
import {CreateNewPost} from './front/CreateNewPost';
import {JobHome} from './front/JobHome';

function App() {
  return (
    <div className="App">
      <Router>
      <Header />     
        <Routes>
          <Route path="/" element={<Home />}></Route>
          <Route path="/Login" element={<Login />}></Route>
          <Route path="/Registration" element={<Registration />}></Route>
          <Route path="/Forgotpassword" element={<Forgotpassword />}></Route>
          <Route path="/PasswordResetting" element={<PasswordResetting />}></Route>
          <Route path="/JobListing" element={<JobListing />}></Route>
          <Route path="/JobAdd" element={<JobAdd />}></Route>
          <Route path="/CreateNewPost" element={<CreateNewPost />}></Route>
          <Route path="/JobHome" element={<JobHome />}></Route>
        </Routes>
        <Footer/>
    </Router>
    </div>
  );
}

export default App;
